function User({user}) {


  return (
    <div className="user">
      {user ? (
        <div>
          <h2>{user.username}</h2>
          <p>First Name: {user.first_name}</p>
          <p>Last Name: {user.last_name}</p>
          <p>Age: {user.age}</p>
          <p>Email: {user.email}</p>
          <p>Bio: {user.bio}</p>
          <img src={user.image.url} alt="profile"></img>

        </div>
      ) : (
        <></>
      )}
    </div>
  );
}

export default User;
